import { Component } from "react";
import { TitleFd, ListFd, ItemFd, BtnFd } from "./Feedback.styled";

export class Feedback extends Component {
  state = {
    BtnFd,
  };
  render() {
    return (
      <>
        <TitleFd>Please leave feedback</TitleFd>
        <ListFd>
          <ItemFd>
            <BtnFd>Good</BtnFd>
          </ItemFd>
          <ItemFd>
            <BtnFd>Neutral</BtnFd>
          </ItemFd>
          <ItemFd>
            <BtnFd>Bad</BtnFd>
          </ItemFd>
        </ListFd>

        <h2>Statistics</h2>
        <ul>
          <li>Good: </li>
          <li>Neutral: </li>
          <li>Bad: </li>
          <li>Total: </li>
          <li>Positive fedback: </li>
        </ul>
      </>
    );
  }
}
